import './App.css';
import React from "react";
import person, {males, females} from './file2';

function App2() {
    const {firstName, email} = person;
    console.log(...males, "Kurt", "Helle", ...females, "Tina");

    return(
      <div className="App">
        <h2>Ex 2</h2>
        <p>{firstName}</p>
        <p>{email}</p>
      </div>
    );
  }

  export default App2;
